import {
	border,
	Box,
	Button,
	Flex,
	Modal,
	ModalBody,
	ModalContent,
	ModalFooter,
	ModalHeader,
	ModalOverlay,
	Text,
	useDisclosure,
} from "@chakra-ui/react";
import React from "react";

const Habits = () => {
	const { isOpen, onOpen, onClose } = useDisclosure();

	return (
		<Box m="5">
			<Flex justifyContent="space-between" alignItems="center">
				<Text fontSize="3xl">Habits</Text>
				<Button onClick={onOpen}>Add Habit</Button>
			</Flex>

			<Text>0 active habit</Text>
			<hr
				style={{
					marginTop: "12",
					height: "1px",
					border: "none",
					backgroundColor: "#1A202C",
				}}
			/>

			<Modal>
				<ModalOverlay />
				<ModalContent>
					<ModalHeader>Title</ModalHeader>
					<ModalBody>Hello</ModalBody>
					<ModalFooter>
						<Button colorScheme="blackAlpha"></Button>
					</ModalFooter>
				</ModalContent>
			</Modal>
		</Box>
	);
};

export default Habits;
